void getstring(void)
{
/* Prende una stringa escludendo le " */
int i=0;
do {
   buffer[i]=yytext[i+1];
   ++i;
   } while (yytext[i]!='"');
buffer[i-1]=0;
yylval.txt=(char *)mymalloc(strlen(buffer)+1);
strcpy(yylval.txt, buffer);
}



